<pre><code>{
    "_id" : MainId,
    "subdoc" : [
        {
            "_id" : SubdocId,
            "userid" : "someid",
            "toupdate": false,
        },
        {
            "_id" : SubdocId2,
            "userid" : "someid2",
            "toupdate": false,
        }       
    ],
    "extra" : [
        "extraid1",
        "extraid2"
    ]
}
</code></pre>

<p>How can I update the subdocument SubdocId2 where the id (SubdocId2) must match and either SubdocId2's userid is "someid2" OR value "extraid1" exists in "extra"?</p>

<p>The farthest I got is:</p>

<pre><code>db.coll.update({
"subdoc._id":"SubdocId2", {
    $or: ["extra":{$in:["extraid1"]}, "subdoc.userid":"someid2"]
    }
}, {"subdoc.$.toupdate":true})
</code></pre>

<p>Maybe I forgot to quote up something, but I get an error <code>(SyntaxError: invalid property id)</code></p>

