NodeJS Express: how to get object item<p>I try to create a simple login form and fail to validate the password from the MongoDB.</p>

<p>First I create the .post route for the form validation and then I get the MongoDB data which I want to compare with the form.</p>

<p>Here is my code:</p>

<pre><code>app.post('/users', (req, res) =&gt; {
  const reqUser = req.body.params.name
  const reqPW = req.body.params.password

  // connect to mongoDB
  const collection = client.db().collection("users")
  collection.find({name: reqUser}).toArray(function (err, results) {
    if (err) {
      console.log(err)
      res.send([])
      return
    }
    else {
      console.log('RESULT', results) // returns the object
      console.log('RES PW', results.password) // returns undefined

      // this does not work
      Object.keys(results).forEach(function(key) {
        console.log('key is: ', key); // returns 0
      });

      // validate user+pw
      if (!reqUser || !reqPW/*|| reqPW !== password*/) {
        return res.status(401).end()
      }

      // send result to frontend
      res.send(results)
      res.end
    }
  })
})
</code></pre>

<p>So, I get my object returned in <code>results</code> but I cannot get the data from the object.
I also tried to convert it to an array with <code>Array.from()</code> but that didn't work either.</p>

<p>Please note that I did not yet implement hashing and salting the passwords yet, as I thought I want a working validation first. Do I need to implement those first?</p>

