Mongo: add fields with count of how many times another field appears<p>I'm new to MongoDB. I am writing an app using mongoose and NodeJS. I start with this collection:</p>
<pre><code>[
  { name: &quot;Joe&quot;, hobby: &quot;Food&quot;},
  { name: &quot;Lyn&quot;, hobby: &quot;Food&quot;},
  { name: &quot;Rex&quot;, hobby: &quot;Play&quot;},
  { name: &quot;Rex&quot;, hobby: &quot;Shop&quot;},
  ...
]
</code></pre>
<p>And I want to output a subset of the documents with two new fields: <code>nameCount</code> showing how many times the document's name value appears, and <code>hobbyCount</code> showing the same thing for the document's hobby:</p>
<pre><code>[
  { name: &quot;Joe&quot;, hobby: &quot;Food&quot;, nameCount: 1, hobbyCount: 2 },
  { name: &quot;Lyn&quot;, hobby: &quot;Food&quot;, nameCount: 1, hobbyCount: 2 },
  { name: &quot;Rex&quot;, hobby: &quot;Play&quot;, nameCount: 2, hobbyCount: 1 },
  { name: &quot;Rex&quot;, hobby: &quot;Shop&quot;, nameCount: 2, hobbyCount: 1 }
]
</code></pre>
<p>From my research and fiddling about I got the following query to work but it seems over the top, inefficient and over-complicated.</p>
<pre><code>db.members.aggregate([
  {$skip: 0},
  {$limit: 4},
  {
    $lookup: {
      from: &quot;members&quot;,
      let: { name: &quot;$name&quot;},
      pipeline: [
        { $match: { $expr: { $eq: [&quot;$name&quot;, &quot;$$name&quot;] } } },
        { $count: &quot;count&quot; }
      ],
      as: &quot;nameCount&quot;
    }
  },
  { $unwind: &quot;$nameCount&quot; },
  { $addFields: { nameCount: &quot;$nameCount.count&quot; } },
  {
    $lookup: {
      from: &quot;members&quot;,
      let: { hobby: &quot;$hobby&quot;},
      pipeline: [
        { $match: { $expr: { $eq: [&quot;$hobby&quot;, &quot;$$hobby&quot;] } } },
        { $count: &quot;count&quot; }
      ],
      as: &quot;hobbyCount&quot;
    }
  },
  { $unwind: &quot;$hobbyCount&quot; },
  { $addFields: { hobbyCount: &quot;$hobbyCount.count&quot; } }
]);
</code></pre>
<p><a href="https://mongoplayground.net/p/q5wWHmdPZG3" rel="nofollow noreferrer"><strong>Mongo Playground</strong></a></p>
<p>It's bugging me in particular, not just that the query seems overdone, but that it looks like I'm running two new searches per record found through the whole collection when maybe the <code>nameCount</code> and <code>hobbyCount</code> could be compiled in a single search.</p>
<h3>Update</h3>
<p>Valijon posted an answer that made me realize that I oversimplified my actual problem when trying to post the minimum required.  In reality the collection is filtered (with a $match, $skip and $take) before the first lookup that I posted. As a result, Valijon's answer doesn't actually work for me, although it's a great answer for the way I originally posed the problem.  Sorry, I'm updating the OP</p>
<p><a href="https://mongoplayground.net/p/hZzuzTnUJJs" rel="nofollow noreferrer">See the playground</a></p>

